import React from "react";
import "../App.css";

export default function Header({ setPageIndex }) {
  const links = ["Home", "Contact", "About", "Projects"];
  return (
    <div className="header">
      {links.map((link, i) => {
        return <div className="header-link">Home</div>;
      })}
      <div className="header-link">Home</div>
      <div className="header-link">Contact</div>
      <div className="header-link">About</div>
      <div className="header-link">Projects</div>
    </div>
  );
}
